@testset "4.2.2.1 (a+b cos)^m (c+d cos)^n" begin
    (A, B, a, b, c, d, e, f, m, n, x, ) = @variables A B a b c d e f m n x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(d*cos(e+f*x))^n*(a+b*cos(e+f*x))^m=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*cos(e+f*x))^n*(a+a*cos(e+f*x))^m=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*cos(e+f*x)^m*(a+a*cos(e+f*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [cos(c + d*x)^5*(a + a*cos(c + d*x)), x, 7, (5*a*x)/16 + (a*sin(c + d*x))/d + (5*a*cos(c + d*x)*sin(c + d*x))/(16*d) + (5*a*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a*cos(c + d*x)^5*sin(c + d*x))/(6*d) - (2*a*sin(c + d*x)^3)/(3*d) + (a*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^4*(a + a*cos(c + d*x)), x, 6, (3*a*x)/8 + (a*sin(c + d*x))/d + (3*a*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (2*a*sin(c + d*x)^3)/(3*d) + (a*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^3*(a + a*cos(c + d*x)), x, 6, (3*a*x)/8 + (a*sin(c + d*x))/d + (3*a*cos(c + d*x)*sin(c + d*x))/(8*d) + (a*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (a*sin(c + d*x)^3)/(3*d)]
    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x)), x, 5, (a*x)/2 + (a*sin(c + d*x))/d + (a*cos(c + d*x)*sin(c + d*x))/(2*d) - (a*sin(c + d*x)^3)/(3*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x)), x, 1, (a*x)/2 + (a*sin(c + d*x))/d + (a*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x)), x, 2, a*x + (a*sin(c + d*x))/d]
    @test_int [sec(c + d*x)^1*(a + a*cos(c + d*x)), x, 2, a*x + (a*atanh(sin(c + d*x)))/d]
    @test_int [sec(c + d*x)^2*(a + a*cos(c + d*x)), x, 4, (a*atanh(sin(c + d*x)))/d + (a*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^3*(a + a*cos(c + d*x)), x, 5, (a*atanh(sin(c + d*x)))/(2*d) + (a*tan(c + d*x))/d + (a*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^4*(a + a*cos(c + d*x)), x, 5, (a*atanh(sin(c + d*x)))/(2*d) + (a*tan(c + d*x))/d + (a*sec(c + d*x)*tan(c + d*x))/(2*d) + (a*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^5*(a + a*cos(c + d*x)), x, 6, (3*a*atanh(sin(c + d*x)))/(8*d) + (a*tan(c + d*x))/d + (3*a*sec(c + d*x)*tan(c + d*x))/(8*d) + (a*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (a*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^6*(a + a*cos(c + d*x)), x, 6, (3*a*atanh(sin(c + d*x)))/(8*d) + (a*tan(c + d*x))/d + (3*a*sec(c + d*x)*tan(c + d*x))/(8*d) + (a*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (2*a*tan(c + d*x)^3)/(3*d) + (a*tan(c + d*x)^5)/(5*d)]


    @test_int [cos(c + d*x)^4*(a + a*cos(c + d*x))^2, x, 11, (11*a^2*x)/16 + (2*a^2*sin(c + d*x))/d + (11*a^2*cos(c + d*x)*sin(c + d*x))/(16*d) + (11*a^2*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a^2*cos(c + d*x)^5*sin(c + d*x))/(6*d) - (4*a^2*sin(c + d*x)^3)/(3*d) + (2*a^2*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^3*(a + a*cos(c + d*x))^2, x, 9, (3*a^2*x)/4 + (2*a^2*sin(c + d*x))/d + (3*a^2*cos(c + d*x)*sin(c + d*x))/(4*d) + (a^2*cos(c + d*x)^3*sin(c + d*x))/(2*d) - (a^2*sin(c + d*x)^3)/d + (a^2*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^2, x, 9, (7*a^2*x)/8 + (2*a^2*sin(c + d*x))/d + (7*a^2*cos(c + d*x)*sin(c + d*x))/(8*d) + (a^2*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (2*a^2*sin(c + d*x)^3)/(3*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^2, x, 2, a^2*x + (2*a^2*sin(c + d*x))/d + (a^2*cos(c + d*x)*sin(c + d*x))/d - (a^2*sin(c + d*x)^3)/(3*d), a^2*x + (4*a^2*sin(c + d*x))/(3*d) + (a^2*cos(c + d*x)*sin(c + d*x))/(3*d) + ((a + a*cos(c + d*x))^2*sin(c + d*x))/(3*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^2, x, 1, (3*a^2*x)/2 + (2*a^2*sin(c + d*x))/d + (a^2*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^1*(a + a*cos(c + d*x))^2, x, 3, 2*a^2*x + (a^2*atanh(sin(c + d*x)))/d + (a^2*sin(c + d*x))/d]
    @test_int [sec(c + d*x)^2*(a + a*cos(c + d*x))^2, x, 5, a^2*x + (2*a^2*atanh(sin(c + d*x)))/d + (a^2*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^3*(a + a*cos(c + d*x))^2, x, 7, (3*a^2*atanh(sin(c + d*x)))/(2*d) + (2*a^2*tan(c + d*x))/d + (a^2*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^4*(a + a*cos(c + d*x))^2, x, 8, (a^2*atanh(sin(c + d*x)))/d + (2*a^2*tan(c + d*x))/d + (a^2*sec(c + d*x)*tan(c + d*x))/d + (a^2*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^5*(a + a*cos(c + d*x))^2, x, 9, (7*a^2*atanh(sin(c + d*x)))/(8*d) + (2*a^2*tan(c + d*x))/d + (7*a^2*sec(c + d*x)*tan(c + d*x))/(8*d) + (a^2*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (2*a^2*tan(c + d*x)^3)/(3*d)]


    @test_int [cos(c + d*x)^3*(a + a*cos(c + d*x))^3, x, 13, (23*a^3*x)/16 + (4*a^3*sin(c + d*x))/d + (23*a^3*cos(c + d*x)*sin(c + d*x))/(16*d) + (23*a^3*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a^3*cos(c + d*x)^5*sin(c + d*x))/(6*d) - (7*a^3*sin(c + d*x)^3)/(3*d) + (3*a^3*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^3, x, 11, (13*a^3*x)/8 + (4*a^3*sin(c + d*x))/d + (13*a^3*cos(c + d*x)*sin(c + d*x))/(8*d) + (3*a^3*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (5*a^3*sin(c + d*x)^3)/(3*d) + (a^3*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^3, x, 8, (15*a^3*x)/8 + (4*a^3*sin(c + d*x))/d + (15*a^3*cos(c + d*x)*sin(c + d*x))/(8*d) + (a^3*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (a^3*sin(c + d*x)^3)/d, (15*a^3*x)/8 + (3*a^3*sin(c + d*x))/d + (9*a^3*cos(c + d*x)*sin(c + d*x))/(8*d) + ((a + a*cos(c + d*x))^3*sin(c + d*x))/(4*d) - (a^3*sin(c + d*x)^3)/(4*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^3, x, 7, (5*a^3*x)/2 + (4*a^3*sin(c + d*x))/d + (3*a^3*cos(c + d*x)*sin(c + d*x))/(2*d) - (a^3*sin(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^1*(a + a*cos(c + d*x))^3, x, 6, (7*a^3*x)/2 + (a^3*atanh(sin(c + d*x)))/d + (3*a^3*sin(c + d*x))/d + (a^3*cos(c + d*x)*sin(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^2*(a + a*cos(c + d*x))^3, x, 6, 3*a^3*x + (3*a^3*atanh(sin(c + d*x)))/d + (a^3*sin(c + d*x))/d + (a^3*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^3*(a + a*cos(c + d*x))^3, x, 7, a^3*x + (7*a^3*atanh(sin(c + d*x)))/(2*d) + (3*a^3*tan(c + d*x))/d + (a^3*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^4*(a + a*cos(c + d*x))^3, x, 9, (5*a^3*atanh(sin(c + d*x)))/(2*d) + (4*a^3*tan(c + d*x))/d + (3*a^3*sec(c + d*x)*tan(c + d*x))/(2*d) + (a^3*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^5*(a + a*cos(c + d*x))^3, x, 11, (15*a^3*atanh(sin(c + d*x)))/(8*d) + (4*a^3*tan(c + d*x))/d + (15*a^3*sec(c + d*x)*tan(c + d*x))/(8*d) + (a^3*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (a^3*tan(c + d*x)^3)/d]
    @test_int [sec(c + d*x)^6*(a + a*cos(c + d*x))^3, x, 11, (13*a^3*atanh(sin(c + d*x)))/(8*d) + (4*a^3*tan(c + d*x))/d + (13*a^3*sec(c + d*x)*tan(c + d*x))/(8*d) + (3*a^3*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (5*a^3*tan(c + d*x)^3)/(3*d) + (a^3*tan(c + d*x)^5)/(5*d)]


    @test_int [cos(c + d*x)^2*(a + a*cos(c + d*x))^4, x, 15, (49*a^4*x)/16 + (8*a^4*sin(c + d*x))/d + (49*a^4*cos(c + d*x)*sin(c + d*x))/(16*d) + (41*a^4*cos(c + d*x)^3*sin(c + d*x))/(24*d) + (a^4*cos(c + d*x)^5*sin(c + d*x))/(6*d) - (4*a^4*sin(c + d*x)^3)/d + (4*a^4*sin(c + d*x)^5)/(5*d)]
    @test_int [cos(c + d*x)^1*(a + a*cos(c + d*x))^4, x, 11, (7*a^4*x)/2 + (8*a^4*sin(c + d*x))/d + (7*a^4*cos(c + d*x)*sin(c + d*x))/(2*d) + (a^4*cos(c + d*x)^3*sin(c + d*x))/d - (8*a^4*sin(c + d*x)^3)/(3*d) + (a^4*sin(c + d*x)^5)/(5*d), (7*a^4*x)/2 + (32*a^4*sin(c + d*x))/(5*d) + (27*a^4*cos(c + d*x)*sin(c + d*x))/(10*d) + (a^4*cos(c + d*x)^3*sin(c + d*x))/(5*d) + ((a + a*cos(c + d*x))^4*sin(c + d*x))/(5*d) - (16*a^4*sin(c + d*x)^3)/(15*d)]
    @test_int [cos(c + d*x)^0*(a + a*cos(c + d*x))^4, x, 10, (35*a^4*x)/8 + (8*a^4*sin(c + d*x))/d + (27*a^4*cos(c + d*x)*sin(c + d*x))/(8*d) + (a^4*cos(c + d*x)^3*sin(c + d*x))/(4*d) - (4*a^4*sin(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^1*(a + a*cos(c + d*x))^4, x, 8, 6*a^4*x + (a^4*atanh(sin(c + d*x)))/d + (7*a^4*sin(c + d*x))/d + (2*a^4*cos(c + d*x)*sin(c + d*x))/d - (a^4*sin(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^2*(a + a*cos(c + d*x))^4, x, 8, (13*a^4*x)/2 + (4*a^4*atanh(sin(c + d*x)))/d + (4*a^4*sin(c + d*x))/d + (a^4*cos(c + d*x)*sin(c + d*x))/(2*d) + (a^4*tan(c + d*x))/d]
    @test_int [sec(c + d*x)^3*(a + a*cos(c + d*x))^4, x, 8, 4*a^4*x + (13*a^4*atanh(sin(c + d*x)))/(2*d) + (a^4*sin(c + d*x))/d + (4*a^4*tan(c + d*x))/d + (a^4*sec(c + d*x)*tan(c + d*x))/(2*d)]
    @test_int [sec(c + d*x)^4*(a + a*cos(c + d*x))^4, x, 9, a^4*x + (6*a^4*atanh(sin(c + d*x)))/d + (7*a^4*tan(c + d*x))/d + (2*a^4*sec(c + d*x)*tan(c + d*x))/d + (a^4*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^5*(a + a*cos(c + d*x))^4, x, 12, (35*a^4*atanh(sin(c + d*x)))/(8*d) + (8*a^4*tan(c + d*x))/d + (27*a^4*sec(c + d*x)*tan(c + d*x))/(8*d) + (a^4*sec(c + d*x)^3*tan(c + d*x))/(4*d) + (4*a^4*tan(c + d*x)^3)/(3*d)]
    @test_int [sec(c + d*x)^6*(a + a*cos(c + d*x))^4, x, 13, (7*a^4*atanh(sin(c + d*x)))/(2*d) + (8*a^4*tan(c + d*x))/d + (7*a^4*sec(c + d*x)*tan(c + d*x))/(2*d) + (a^4*sec(c + d*x)^3*tan(c + d*x))/d + (8*a^4*tan(c + d*x)^3)/(3*d) + (a^4*tan(c + d*x)^5)/(5*d)]
    @test_int [sec(c + d*x)^7*(a + a*cos(c + d*x))^4, x, 15, (49*a^4*atanh(sin(c + d*x)))/(16*d) + (8*a^4*tan(c + d*x))/d + (49*a^4*sec(c + d*x)*tan(c + d*x))/(16*d) + (41*a^4*sec(c + d*x)^3*tan(c + d*x))/(24*d) + (a^4*sec(c + d*x)^5*tan(c + d*x))/(6*d) + (4*a^4*tan(c + d*x)^3)/d + (4*a^4*tan(c + d*x)^5)/(5*d)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [cos(c + d*x)^5/(a + a*cos(c + d*x)), x, 7, (15*x)/(8*a) - (4*sin(c + d*x))/(a*d) + (15*cos(c + d*x)*sin(c + d*x))/(8*a*d) + (5*cos(c + d*x)^3*sin(c + d*x))/(4*a*d) - (cos(c + d*x)^4*sin(c + d*x))/(d*(a + a*cos(c + d*x))) + (4*sin(c + d*x)^3)/(3*a*d)]
    @test_int [cos(c + d*x)^4/(a + a*cos(c + d*x)), x, 6, -((3*x)/(2*a)) + (4*sin(c + d*x))/(a*d) - (3*cos(c + d*x)*sin(c + d*x))/(2*a*d) - (cos(c + d*x)^3*sin(c + d*x))/(d*(a + a*cos(c + d*x))) - (4*sin(c + d*x)^3)/(3*a*d)]
    @test_int [cos(c + d*x)^3/(a + a*cos(c + d*x)), x, 2, (3*x)/(2*a) - (2*sin(c + d*x))/(a*d) + (3*cos(c + d*x)*sin(c + d*x))/(2*a*d) - (cos(c + d*x)^2*sin(c + d*x))/(d*(a + a*cos(c + d*x)))]
    @test_int [cos(c + d*x)^2/(a + a*cos(c + d*x)), x, 4, -(x/a) + sin(c + d*x)/(a*d) + sin(c + d*x)/(a*d*(1 + cos(c + d*x)))]
    @test_int [cos(c + d*x)^1/(a + a*cos(c + d*x)), x, 2, x/a - sin(c + d*x)/(d*(a + a*cos(c + d*x)))]
    @test_int [cos(c + d*x)^0/(a + a*cos(c + d*x)), x, 1, sin(c + d*x)/(d*(a + a*cos(c + d*x)))]
    @test_int [sec(c + d*x)^1/(a + a*cos(c + d*x)), x, 3, atanh(sin(c + d*x))/(a*d) - sin(c + d*x)/(d*(a + a*cos(c + d*x)))]
    @test_int [sec(c + d*x)^2/(a + a*cos(c + d*x)), x, 5, -(atanh(sin(c + d*x))/(a*d)) + (2*tan(c + d*x))/(a*d) - tan(c + d*x)/(d*(a + a*cos(c + d*x)))]
    @test_int [sec(c + d*x)^3/(a + a*cos(c + d*x)), x, 6, (3*atanh(sin(c + d*x)))/(2*a*d) - (2*tan(c + d*x))/(a*d) + (3*sec(c + d*x)*tan(c + d*x))/(2*a*d) - (sec(c + d*x)*tan(c + d*x))/(d*(a + a*cos(c + d*x)))]
    @test_int [sec(c + d*x)^4/(a + a*cos(c + d*x)), x, 6, -((3*atanh(sin(c + d*x)))/(2*a*d)) + (4*tan(c + d*x))/(a*d) - (3*sec(c + d*x)*tan(c + d*x))/(2*a*d) - (sec(c + d*x)^2*tan(c + d*x))/(d*(a + a*cos(c + d*x))) + (4*tan(c + d*x)^3)/(3*a*d)]


    @test_int [cos(c + d*x)^5/(a + a*cos(c + d*x))^2, x, 7, -((5*x)/a^2) + (12*sin(c + d*x))/(a^2*d) - (5*cos(c + d*x)*sin(c + d*x))/(a^2*d) - (10*cos(c + d*x)^3*sin(c + d*x))/(3*a^2*d*(1 + cos(c + d*x))) - (cos(c + d*x)^4*sin(c + d*x))/(3*d*(a + a*cos(c + d*x))^2) - (4*sin(c + d*x)^3)/(a^2*d)]
    @test_int [cos(c + d*x)^4/(a + a*cos(c + d*x))^2, x, 3, (7*x)/(2*a^2) - (16*sin(c + d*x))/(3*a^2*d) + (7*cos(c + d*x)*sin(c + d*x))/(2*a^2*d) - (8*cos(c + d*x)^2*sin(c + d*x))/(3*a^2*d*(1 + cos(c + d*x))) - (cos(c + d*x)^3*sin(c + d*x))/(3*d*(a + a*cos(c + d*x))^2)]
    @test_int [cos(c + d*x)^3/(a + a*cos(c + d*x))^2, x, 6, -((2*x)/a^2) + (4*sin(c + d*x))/(3*a^2*d) + (2*sin(c + d*x))/(a^2*d*(1 + cos(c + d*x))) - (cos(c + d*x)^2*sin(c + d*x))/(3*d*(a + a*cos(c + d*x))^2)]
    @test_int [cos(c + d*x)^2/(a + a*cos(c + d*x))^2, x, 3, x/a^2 - (5*sin(c + d*x))/(3*a^2*d*(1 + cos(c + d*x))) + sin(c + d*x)/(3*d*(a + a*cos(c + d*x))^2)]
    @test_int [cos(c + d*x)^1/(a + a*cos(c + d*x))^2, x, 2, -(sin(c + d*x)/(3*d*(a + a*cos(c + d*x))^2)) + (2*sin(c + d*x))/(3*d*(a^2 + a^2*cos(c + d*x)))]
    @test_int [cos(c + d*x)^0/(a + a*cos(c + d*x))^2, x, 2, sin(c + d*x)/(3*d*(a + a*cos(c + d*x))^2) + sin(c + d*x)/(3*d*(a^2 + a^2*cos(c + d*x)))]
